import Navbar from "./components/Navbar";
import Home from "./components/Home";
import { BrowserRouter as Router,Route} from 'react-router-dom';
import { Switch } from 'react-router-dom';

import './App.css';


function App() {
  return (
    <>
    <Router>
     <Navbar/>
      <Switch>
          <Home/>
      </Switch>
    </Router>
    </>

  );
}

export default App;
